import React from "react";

const SpotifyPlaylist = ({ title, handleClick, spotifyDeselectPlaylist }) => {
	// console.log(title);
	return (
		<div className="playlist" onClick={handleClick} onDoubleClick={spotifyDeselectPlaylist}>
			<p>{title}</p>
		</div>
	);
};

SpotifyPlaylist.defaultProps = {
	title: "Title?",
};

export default SpotifyPlaylist;
